Set up a library project with cargo, and add the following to the [dependencies] section in your Cargo.toml: perseus = { path = "../../packages/perseus" }
sycamore = { version = "0.5.1", features = ["ssr"] }
sycamore-router = "0.5.1"
# You only need these for pages that take properties
serde = { version = "1", features = ["derive"] }
serde_json = "1" Then, add a lib.rs file to your project under src/ that contains the following: mod pages;
mod error_pages; use perseus::define_app; #[derive(perseus::Route)]
pub enum Route { #[to("/")] Index, #[to("/about")] About, #[not_found] NotFound,
}
define_app!{ root: "#root", route: Route, router: { Route::Index => [ "index".to_string(), pages::index::template_fn() ], Route::About => [ "about".to_string(), pages::about::template_fn() ] } error_pages: crate::error_pages::get_error_pages(), templates: [ crate::pages::index::get_template::<G>(), crate::pages::about::get_template::<G>() ] // config_manager: perseus::FsConfigManager::new()
} This assumes you've defined a function to get your error pages elsewhere (you can read more about that here ), and that it's in a module called error_pages, you can customize that as needed. The way the rest of this works is pretty simple. First off, you define a router with Sycamore , which defines each of your templates and the paths on your site that it will accept. This must have a variant explicitly named NotFound, that's handled for you. Then, you define your app itself, which takes the following properties (which need to be in order right now!): root – the CSS selector for the element to render Perseus to, which should be unique, like an HTML id route – the enum for your app's routes that you just defined router – a match-like input that handles each of the variants of your route, except NotFound (handled for you); each one gets mapped to the corresponding page's path (e.g. Post with slug test might be mapped to format!("post/{}", slug)), which shouldn't include a leading or trailing / error_pages – your error pages templates – each of your templates, taking the G parameter (which will be used at runtime to render them for the server or the client) config_manager (optional) – the config manager your app should use, default is the inbuilt FsConfigManager::new()

