The easiest way of defining your error pages is to put them into a function like get_error_pages, like so: use sycamore::prelude::template;
use perseus::ErrorPages; pub fn get_error_pages() -> ErrorPages { let mut error_pages = ErrorPages::new(Box::new(|_, _, _| { template! { p { "Another error occurred." } } })); error_pages.add_page( 404, Box::new(|_, _, _| { template! { p { "Page not found." } } }), ); error_pages.add_page( 400, Box::new(|_, _, _| { template! { p { "Client error occurred..." } } }), ); error_pages
} This example creates three error pages, the first of which is mandatory: a fallback page. There are a lot of HTTP status codes, and it would be ridiculous for you to handle them all. However, occasionally you may get one that you didn't anticipate, and you should be ready for it. The rest of the error pages are defined specifically for error codes, like 404 and 400 above. Every error page is a function that takes three arguments: the URL that caused the problem, the HTTP status code, and the error message that was the payload of the request.

