This is a simplified version of an Actix Web converter: use perseus::{HttpRequest, Request}; /// Converts an Actix Web request into an `http::request`.
pub fn convert_req(raw: &actix_web::HttpRequest) -> Result<Request, String> { let mut builder = HttpRequest::builder(); // Add headers one by one for (name, val) in raw.headers() { // Each method call consumes and returns `self`, so we re-self-assign builder = builder.header(name, val); } // The URI to which the request was sent builder = builder.uri(raw.uri()); // The method (e.g. GET, POST, etc.) builder = builder.method(raw.method()); // The HTTP version used builder = builder.version(raw.version()); let req = builder // We always use an empty body because, in a Perseus request, only the URI matters // Any custom data should therefore be sent in headers (if you're doing that, consider a dedicated API) .body(()) .map_err(|err| format!("converting actix web request to perseus-compliant request failed: '{}'", err))?; Ok(req)
} Notably, the data that need to be converted are: Headers URI to which the request was sent HTTP method (subject to change in future Perseus versions, currently GET) HTTP version used Note that mis-converting any of these data will not affect Perseus (which doesn't require any of them to function), only your own code. So if you have no intention of using the request state strategy in your app, you could theoretically just parse an empty request to Perseus like so: use perseus::HttpRequest HttpRequest::new(());

